literals:
.axis path,
.axis line {
  fill: none;
  stroke: #000;
  shape-rendering: crispEdges;
}

.x.axis path {
  display: none;
}

.line {
  fill: none;
  stroke: #82bf5e;
  stroke-width: 1.5px;
}

.lineUp80 {
  fill: none;
  stroke: orange;
  stroke-width: 1.5px;
    stroke-dasharray: 5,5; 

}
.lineUp95 {
  fill: none;
  stroke: red;
  stroke-width: 1.5px;
    stroke-dasharray: 5,5; 

}


.lineLow95 {
  fill: none;
  stroke: green;
  stroke-width: 1.5px;
    stroke-dasharray: 5,5; 

}
.lineLow80 {
  fill: none;
  stroke: gold;
  stroke-width: 1.5px;
    stroke-dasharray: 5,5; 

}

svg {
  background: url("src/public/sprites/grid_paper.png");
  font-family: monospace;
}

svg text {
  font-family: monospace;
}

analytics-clustering-output md-card {
  background: #303030;
}
md-spinner svg{
background: none;
}
md-card{
margin:5px;
}
